def smooth_list_golay(input_list, window_size, order):
    if window_size % 2 == 0:
        raise ValueError("Window size must be odd.")
    if not (0 < order < window_size):
        raise ValueError("Order must be less than window size.")
    return savgol_filter(input_list, window_size, order)


def moving_average(input_list, window_size=5):
    averages = []
    for i in range(len(input_list) - window_size + 1):
        window = input_list[i : i + window_size]
        window_average = sum(window) / window_size
        averages.append(window_average)
    return averages



